import React from 'react';
import Card from '../UI/Card';
import classes from './Items.module.css';




const Items = (props) => {
  return (
    <Card >
    <li className={classes.list}>
      <h2 className={classes.title}>{props.title}</h2>
      <h3>{props.price}</h3>
      <p>{props.brand}</p>
    </li>
    </Card>
  );
};

export default Items;
